import React from 'react';
import classes from './Productcategory.module.css';
import { Row, Col, Container } from 'react-bootstrap';
import Card from "@material-tailwind/react/Card";

import demo1 from '../../assets/images/AORUS3080Ti12G.png';
import demo2 from '../../assets/images/gigmonitor.png';
import demo3 from '../../assets/images/mb.png';
import demo4 from '../../assets/images/laptop.png';
import Button from '@material-tailwind/react/Button';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart, faShoppingCart } from "@fortawesome/free-solid-svg-icons";

function Productcategory() {

    return (



                <Row className={classes.GridRowStyle}>
                    <Col className={classes.GridColStyle}>


                        <Row>
                        <div class="py-20">
                                    <div class="">
                            <Col>

                                            <div class="w-full py-20 px-10 w-2/3 bg-green-300 flex flex-col space-y-5 mx-auto rounded-3xl shadow-xl hover:rotate-1 transition-transform">
                                                <h1 class=" font-medium text-white text-xl tracking-wide">Workcation</h1>
                                                <h2 class="font-normal tracking-wide text-2xl text-white lg:w-2/5">Workflow has completely transformed how we interact with our customers. We've seen record bookings, higher customer satisfaction and reduced churn</h2>
                                                <div class="flex flex-col">
                                                    <backquotes class="font-normal text-white text-sm tracking-wider">Marie Chivers </backquotes>
                                                    <backqoutes class="font-normal text-white text-sm tracking-wider">CEO Workcation</backqoutes>
                                                </div>
                                            </div>



                            </Col>
                            <Col>
                            <img className={classes.GridImageStyle}
                            src={demo1}
                            alt="Card Image"
                            />
                            </Col>
                            </div>
                        </div>

                        </Row> 


                    </Col>

                    <Col className={classes.GridColStyle}>


                    <Row>
                    <Col>
                            <div class="py-20">
                                <div class="">
                                        <div class="w-full py-20 px-10 w-2/3 bg-blue-500 flex flex-col space-y-5 mx-auto rounded-3xl shadow-xl hover:rotate-1 transition-transform">
                                            <h1 class=" font-medium text-white text-xl tracking-wide">Workcation</h1>
                                            <h2 class="font-normal tracking-wide text-2xl text-white lg:w-2/5">Workflow has completely transformed how we interact with our customers. We've seen record bookings, higher customer satisfaction and reduced churn</h2>
                                            <div class="flex flex-col">
                                                <backquotes class="font-normal text-white text-sm tracking-wider">Marie Chivers </backquotes>
                                                <backqoutes class="font-normal text-white text-sm tracking-wider">CEO Workcation </backqoutes>
                                            </div>
                                        </div>

                                </div>
                            </div>

                        </Col>


                    </Row>


                    </Col>


                </Row>





    )
}

export default Productcategory;
